import {Card, CardContent, Typography, Button, CardActions, Rating} from '@mui/material';
import {useHistory} from 'react-router-dom';
import { SERVICES_ROUTE } from '../../utils/constants';

const ServiceItem = ({service}) => {
  const navigate = use
  return (
    <Card sx={{ minWidth: 275 }} className='service-card'>
      <CardContent>
        <Typography sx={{ fontSize: 20 }} color="text.secondary" gutterBottom>
          Service
        </Typography>
        <Typography variant="h5" component="div">
          {service.title}
        </Typography>
        <Typography sx={{ mb: 1.5 }} color="text.secondary">
          {service.description}
        </Typography>
        <Typography variant="body2">
          {service.price}
        </Typography>
        <Rating className='rating' readOnly value={service.rating}></Rating>
      </CardContent>
      <CardActions>
        <Button size="small" onClick={() => history.push(SERVICES_ROUTE + '/' + service.id)}>Learn More</Button>
      </CardActions>
    </Card>
  );
}

export default ServiceItem;
